/* eslint-disable @typescript-eslint/no-explicit-any */
declare module '*.jpeg' {
  const value: any;
  export default value;
}

declare module '*.png' {
  const value: any;
  export default value;
}

declare module '*.svg' {
  const value: any;
  export default value;
}

declare module '*.md' {
  const content: string;
  export default content;
}
